"use strict";
const axios = require("axios");
const config = require("../../../../Config.js");
const apiCommonController = require("../../../../Utility/APICommonController.js");
const xml2json = require('xml-js');


const response = {
    // Build search data and get search response. 
    getSearchApiReponse: async (clientId, url, searchObject, providerDetails) => {
        let fName = "Search_ApiResponse_";
        let fPath = await apiCommonController.logsFolderStructureBuilder(clientId, config.SERVICE_SEARCH_PROVIDER_RESPONSE_FILE_PATH, config.Provider_Code_OWT);
        try {
            // Get supplier chain code.
            let supplierChainCodes = searchObject.supplierChainCodes ?? [];

            let requestArr = [];
            for(const chainCode of supplierChainCodes){
                let axiosRequest = await fetchSupplierLocations(clientId, chainCode, searchObject, url, providerDetails);
                // Checking the response status.
                if(axiosRequest.status){
                    let xmlData = axiosRequest.Data;
                    // Convert the xml data to json format.
                    let jsonData = xml2json.xml2json(xmlData, {compact: true, spaces: 4, explicitArray: true});
                    // Check the converted data is error or not.
                    if(!JSON.parse(jsonData)?.OTAX_TourActivityAvailRS?.Errors){

                        jsonData = JSON.parse(jsonData)?.OTAX_TourActivityAvailRS?.Activities?.Activity || [];
                        jsonData.map(item => item._attributes.chainCode = chainCode);
                        requestArr.push(...jsonData);

                    } else{
                        // Find the error data.
                        if(JSON.parse(jsonData)?.OTAX_TourActivityAvailRS?.Errors?.Error[0]){
                            throw new Error(JSON.parse(jsonData)?.OTAX_TourActivityAvailRS?.Errors?.Error[0]?._attributes?.ShortText);
                        } else{
                            let error = JSON.parse(jsonData)?.OTAX_TourActivityAvailRS?.Errors?.Error?._attributes?.ShortText;
                            throw new Error(error);
                        }
                        
                    }
                                        
                } else{                    
                    return axiosRequest;                    
                }
            }            
            return requestArr;          
        } catch (err) {
            // Handle error safely and add logs            
            const errorObj = {
                "STATUS": "ERROR",
                "RESPONSE": {
                    "text": err.message
                }
            };
            apiCommonController.getError(errorObj, fName, fPath, JSON.stringify(searchObject));
            return errorObj;
        }
    }
}

