// Function to handle guest count
async function handleGuestCounts(searchObject, GuestCounts){
    if(searchObject?.selectedPassengersData?.length != 0){
        GuestCounts = `<GuestCounts>\n`
        for(let pax of searchObject?.selectedPassengersData){
          if((pax.type == "A" || pax.type == "C" || pax.type == "I") &&  pax.age){
            GuestCounts += `<GuestCount Age="${pax.age}" Count="1"/>\n`
          }
        }
       GuestCounts += `</GuestCounts>`
    }
    return GuestCounts;
}

// Function for create logs
async function createLogs(url, fName, fPath, searchObject, response){
    let createLogs = apiCommonController.createFullApiLog(url, searchObject, response, "");
    apiCommonController.doLogs(createLogs, fName, fPath);
}

